using NUnit.Framework;

namespace CodingExercise.UnitTest
{
    public class GetLargestAndSmallestNumberTest
    {
        private ICodingExercise _codingExercise;
        [SetUp]
        public void Setup()
        {
            _codingExercise = new CodingExercise();
        }

        [Test]
        public void TestForEmptyAndNullArray()
        {
            var result = _codingExercise.GetLargestAndSmallestNumber(new double[] { });
            Assert.IsNull(result.LargestNumber);
            Assert.IsNull(result.SmallestNumber);

            result = _codingExercise.GetLargestAndSmallestNumber(null);
            Assert.IsNull(result.LargestNumber);
            Assert.IsNull(result.SmallestNumber);
        }


        [Test]
        public void TestForArrayWithOneElement()
        {
            var result = _codingExercise.GetLargestAndSmallestNumber(new double[] { 10.3 });
            Assert.IsTrue(result.LargestNumber == result.SmallestNumber);
            Assert.IsTrue(result.LargestNumber == 10.3);
        }

        [Test]
        public void TestForMultipleElements()
        {
            var result = _codingExercise.GetLargestAndSmallestNumber(new double[] { 10.3, 64, 5.3, 34, 2.3, 64.01, 3, 2, 43, 11, 9, 23 });
            Assert.IsTrue(result.SmallestNumber == 2);
            Assert.IsTrue(result.LargestNumber == 64.01);
        }


